contracts/FundMe.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

import "./PriceConvertor.sol";

contract FundMe {
    using PriceConvertor for uint256;
    uint256 minUsd = 50;
    address[] public funders;
    mapping(address => uint256) addressToAmount;

    function fund() public payable {
        require(msg.value.getConversionRate() >= minUsd, "Didn't enugh money"); // here 2nd arg is revert functions
        //here require acts like a checker for send money,
        // msg is a global obj
        funders.push(msg.sender);
        addressToAmount[msg.sender] = msg.value;
    }


    function withdraw() public {
        for(uint256 index = 0; index< funders.length; index++){
            addressToAmount[funders[index]] = 0;
        }

        funders = new address[](0);

        // send back the funds to addresses
        // transfer
        // call
        // send
        payable(msg.sender).transfer(address(this).balance);
        // only payble addresses we can send money

        // using send
        bool sendSuccess = payable(msg.sender).send(address(this).balance);
        require(sendSuccess, "Send Faild");

        // using call

        (bool callSuccess,  )= payable(msg.sender).call{value: address(this).balance}("");
    }
}

contracts/PriceConvertor.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

library PriceConvertor {
    function getPrice() public view returns (uint256) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(
            0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e
        );
        (, int256 price, , , ) = priceFeed.latestRoundData();
        return uint256(price * 1e10);
    }

    function getVersion() public view returns (uint256) {
        AggregatorV3Interface price = AggregatorV3Interface(
            0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e
        );
        return price.version();
    }

    function getConversionRate(uint256 ethAmount)
        public
        view
        returns (uint256)
    {
        uint256 priceRate = getPrice();
        uint256 ethAmountInUsd = (priceRate * ethAmount) / 1e18;
        return ethAmountInUsd;
    }

}

